import React, { useState } from 'react';
import './App.css';

import Header from "./components/Header";


const App = () => {

  const [userAuth, setUserAuth] = useState({
    authed: true
  })

  return (
    <div>
      <Header authed={userAuth.authed} />
    </div>
  );
}

export default App;
